          'Content-Type': 'application/json',
          'Authorization': `Bearer ${userToken}`
        },
      }); let results= response.json()
      console.log(results)
      setAllMessages(results.data.messages)
      setUserPosts(results.data.posts)
      } catch (error) {

      }
    }
    fetchMe()
    },[])

    return(
      <>
      <h2>Messages</h2>

      <h2>User Posts</h2>
      </>
    )



}

export default Profile;
